import React from "react";

function Card(props) {
  return (
    <div id="card">
      <article className="card">
        <button className="card__delete button-hover" type="button"></button>
        <img
          className="card__image"
          src={props.link}
          alt={props.name}
        />
        <div className="card__name">
          <h2 className="card__title">{props.name}</h2>
          <div className="card__likes">
            <button className="card__like" type="button"></button>
            <h4 className="card__count-likes">{props.likes}</h4>
          </div>
        </div>
      </article>
    </div>
  );
}
export default Card;
